import React from "react";
import "./Contact.css";

const Contact = () => {
  return (
    <div className="Contact">
      <div className="social">
      <a class="btn btn-primary" style="background-color: #0082ca;" href="#!" role="button"
        ><i class="fab fa-linkedin-in"></i></a>
      </div>
    </div>
  );
};
export default Contact;
